const RootLayout = () => {
    return (
       <>
          <nav className="flex justify-between">
             <NavLink to="/" className="flex-1">
                الشراء
             </NavLink>
             <NavLink to="sales" className="block">
                المبيعات
             </NavLink>
          </nav>
          <main>
             <Outlet />
          </main>
       </>
    );
}

export default RootLayout;
